import * as React from 'react';
import TextField from '@mui/material/TextField';
import { useHistory } from 'react-router-dom';
import Autocomplete from '@mui/material/Autocomplete';

export default function SearchRecord({records}) {
  const history = useHistory();
  console.log(records);
  const dateList = records.map((record) => record.dateRecord);
  const idDoctor = localStorage.getItem('token');
  const [idP] = useState(params.idPatient);
  return (
    <Autocomplete
      disablePortal
      id="combo-box-demo"
      options={dateList} //Aquí va la lista de pacientes
      sx={{ width: 300 }}
      onChange={(_, value) =>  history.push(`/view-record/${idDoctor}/${idP}/${value}`)}
      renderInput={(params) => <TextField {...params} label="Busca registro" />}
    />
  );
}
